import React from 'react';
import prdtoy from '../../models/prdtoy'; // Update the path accordingly

function Show({ fruit }) {
  const { name, color, readyToEat } = fruit;

  return (
    <>
      <div>
        <h1>{name}</h1>
        <p style={{ color: color }}>Color: {color}</p>
        <p>{readyToEat ? "Add to Cart" : "It needs a bit more time before it's Edible"}</p>
      </div>
    </>
  );
}

export default Show;






